
DROP TABLE IF EXISTS school_international_application;
DROP TABLE IF EXISTS school_speciality;
DROP TABLE IF EXISTS princeton_review_great_school_major;
DROP TABLE IF EXISTS best_school_major;
DROP TABLE IF EXISTS major;
DROP TABLE IF EXISTS a_schools_for_b_students;
DROP TABLE IF EXISTS School;



CREATE TABLE School
(
  Id INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  Rank_Overall INT,
  Name VARCHAR(100) NOT NULL,
  Size INT,
  In_State_Tuition_Fee INT DEFAULT NULL,
  Tuition_Fee INT,
  Room_Board INT,
  Average_Freshman_Retention_Rate INT,
  Six_Year_Graduation_Rate INT,
  SAT1_Percentile_25 INT,
  SAT1_Percentile_75 INT,
  SAT2_Required INT,
  ACT_Percentile_25 INT,
  ACT_Percentile_75 INT,
  SAT_ACT_Not_Required VARCHAR(5) DEFAULT NULL,
  Accept_Rate FLOAT,
  Reputation_Score FLOAT,
  Selectivity VARCHAR(15),
  HS_Class_Top_10_Percentage FLOAT,
  Student_Faculty_Ratio FLOAT,
  Percentage_Classes_Fewer_Than_20_students FLOAT,
  Percentage_Classes_More_Than_50_students FLOAT,
  Application_Deadline VARCHAR(10),
  Application_Fee INT,
  SAT_ACT_Received_Deadline VARCHAR(10),
  Early_Decision_Deadline VARCHAR(10),
  Category VARCHAR(40),
  Type VARCHAR(20),
  City VARCHAR(80),
  State VARCHAR(2),
  Setting VARCHAR(15),
  Calendar VARCHAR(20),
  Phone VARCHAR(20),
  Website VARCHAR(100),
  Average_GPA FLOAT,
  INDEX NameIndex(Name)
);

CREATE TABLE school_international_application
(
  Id INT PRIMARY KEY,
  Name VARCHAR(100) NOT NULL,
  Application_Deadline_Fall VARCHAR(30), 
  Application_Deadline_Spring VARCHAR(80),
  Separate_Application_Form_Rrequired VARCHAR(10),
  Conditional_Admission_Offered VARCHAR(10),
  TOEFL_Accepted_Instead_Of_SAT_Or_ACT VARCHAR(10),
  Minimum_TOEFL_Score_Required VARCHAR(10),
  Average_TOEFL_Score_Required VARCHAR(10),
  Minimum_IELTS_Score_Required VARCHAR(10),
  Average_IELTS_Score_Required VARCHAR(10),
  International_Students_Applying INT,
  International_Students_Accepted INT,
  International_Freshmen_Enrolled INT,
  Intl_Financial_Aid VARCHAR(25),
  Contact varchar(250),
  Note varchar(200)  
);

CREATE TABLE school_speciality
(
  School_Id INT NOT NULL,
  Rank INT,
  Score FLOAT,
  School_Name VARCHAR(80),
  Speciality VARCHAR(30),
  Primary Key (School_Id, Speciality),
  FOREIGN KEY (School_Id) REFERENCES school (Id)

);

CREATE TABLE major
(
  Id VARCHAR(10) NOT NULL PRIMARY KEY,
  Name VARCHAR(100) NOT NULL
);

CREATE TABLE best_school_major
(
  Major_Id VARCHAR(10) NOT NULL,
  Rank INT,
  School_Id INT NOT NULL,
  School_Name VARCHAR(80),
  Primary Key (Major_Id, School_Id),
  FOREIGN KEY (School_Id) REFERENCES school (Id),
  FOREIGN KEY (Major_Id) REFERENCES major (Id)
);

CREATE TABLE a_schools_for_b_students
(
  School_Id INT NOT NULL,
  School_Name VARCHAR(80),
  Primary Key (School_Id),
  FOREIGN KEY (School_Id) REFERENCES school (Id)
);

